var map, heatmap;

$(document).ready(function () {
    $('[data-toggle="tooltip"]').tooltip();
});

function initMap() {
    map = new google.maps.Map(document.getElementById('map'), {
        zoom: 13,
        center: {lat: 37.775, lng: -122.434},
        mapTypeId: 'satellite'
    });

    heatmap = new google.maps.visualization.HeatmapLayer({
        data: getWomanData(),
        map: map
    });
    heatmap.setMap(null);

}

function toggleHeatmap() {
    heatmap.setMap(heatmap.getMap() ? null : map);
}

function changeGradient() {
    var gradient = [
        'rgba(0, 255, 255, 0)',
        'rgba(0, 255, 255, 1)',
        'rgba(0, 191, 255, 1)',
        'rgba(0, 127, 255, 1)',
        'rgba(0, 63, 255, 1)',
        'rgba(0, 0, 255, 1)',
        'rgba(0, 0, 223, 1)',
        'rgba(0, 0, 191, 1)',
        'rgba(0, 0, 159, 1)',
        'rgba(0, 0, 127, 1)',
        'rgba(63, 0, 91, 1)',
        'rgba(127, 0, 63, 1)',
        'rgba(191, 0, 31, 1)',
        'rgba(255, 0, 0, 1)'
    ]
    heatmap.set('gradient', heatmap.get('gradient') ? null : gradient);
}


function aboutOnClick() {

    
        $('.buttonAbout').css({
            'opacity': 0.4
        });
    
    plotData();

}

var isWomanActive = false;

function womanOnClick() {

    isWomanActive = !isWomanActive;
    if (isWomanActive) {
        $('.buttonWoman').css({
            'opacity': 0.4
        });
    } else {
        $('.buttonWoman').css({
            'opacity': 1
        });
    }
    plotData();
}

