var isTouristsActive=false;

function touristsOnClick() {

    isTouristsActive = !isTouristsActive;
    if (isTouristsActive) {
        $('.buttonTourists').css({
            'opacity': 0.4
        });
    } else {
        $('.buttonTourists').css({
            'opacity': 1
        });
    }
    plotData();


}

function plotData() {
    heatmap.set("data", null);
    var finalPoints = [];
    if (isWomanActive) {
        console.log("MULHER")
        finalPoints = finalPoints.concat(getWomanData());

    }
    if (isHouseActive) {
        console.log("HOUSE ACTIVE");
        finalPoints = finalPoints.concat(getHouseData());
    }
    if (isTouristsActive) {
        console.log("Tourism ACTIVE");
        finalPoints = finalPoints.concat(getTouristsData());
    }
    if (isCarActive){
        console.log("CAR ACTIVE");
        finalPoints = finalPoints.concat(getCarData());
    }
    heatmap = new google.maps.visualization.HeatmapLayer({
        data: finalPoints,
        map: map
    });

}

// Heatmap data: 500 Points
function getTouristsData() {
    arrayVal = [];
    for (var i in touristsData) {
        var X = touristsData[i].X;
        var Y = touristsData[i].Y;
        var value = new google.maps.LatLng(Y, X);
        arrayVal.push(value);
    }
    return arrayVal;
}

function getHouseData() {
    arrayVal = [];
    for (var i in houseData) {
        var X = houseData[i].X;
        var Y = houseData[i].Y;
        var value = new google.maps.LatLng(Y, X);
        arrayVal.push(value);
    }
    return arrayVal;
}


function getWomanData() {
    arrayVal = [];
    for (var i in womanData) {
        var X = womanData[i].X;
        var Y = womanData[i].Y;
        var value = new google.maps.LatLng(Y, X);
        arrayVal.push(value);
    }
    return arrayVal;
}

function getCarData() {
    arrayVal = [];
    for (var i in carData) {
        var X = carData[i].X;
        var Y = carData[i].Y;
        var value = new google.maps.LatLng(Y, X);
        arrayVal.push(value);
    }
    return arrayVal;
}


